import React from "react";

const Table = () => {
  return (
    <div className={styles.main}>
      <div>
        {" "}
        <table>
          <tr>
            <th>Firstname</th>
            <th>Lastname</th>
          </tr>
          <tr>
            <td>Peter</td>
            <td>Griffin</td>
          </tr>
          <tr>
            <td>Lois</td>
            <td>Griffin</td>
          </tr>
        </table>
      </div>
    </div>
  );
};

export default Table;
